import React, { useEffect } from 'react'
import { apis } from '../../Apis/apis'
import { useDispatch, useSelector } from 'react-redux'
import { getItems } from '../../Slices/ItemsSlice'
import Item from '../Item/Item'
import { filterProductsData } from '../../helpers/filterProductsData'
import { productsType } from '../../types/Types'
import Cart from '../Cart/Cart'
import { useAxios } from '../../Hooks/useAxios'

const Items = () => {
  const dispatch = useDispatch()
  const items: productsType[] = useSelector((state: any) => state.items)
  const {response, error, loading} = useAxios(apis.products)


  useEffect(() => {
    const filteredData: productsType[] = filterProductsData(response)
    dispatch(getItems(filteredData))
    console.log(response)
    console.log(filteredData)
    console.log(items)
  }, [response])
  
  return (
    <div>
    <Cart/>
      {
        items.map((item: productsType) => <Item key={item.id} item = {item}/>)
      }
    </div>
  )
}

export default Items
